import MyInfo from "./MyInfo";
import Timer from "./Timer";
import TodoItem from "./TodoItem";
function MainContent() {
  const firstName = "Tuan";
  const lastName = "Nguyen";

  return (
    <div>
      <h1>Hello {firstName + " " + lastName}</h1>
      <Timer />
      <TodoItem />
    </div>
  );
}

export default MainContent;
